import React from "react";
import "./css/CovidAdd.css";
import { HiOutlineChevronDoubleRight } from "react-icons/hi";

function CovidAdd() {
  let date = new Date();
  date.toString();
  const months = [
    "Jan",
    "Feb",
    "Mar",
    "Apr",
    "May",
    "Jun",
    "Jul",
    "Aug",
    "Sep",
    "Oct",
    "Nov",
  ];
  days = [
    "Sunday",
    "Monday",
    "Tuesday",
    "Wednesday",
    "Thursday",
    "Friday",
    "Saturday",
  ];
  const [today, day, month, year] = [
    date.getUTCDate(),
    date.getDay(),
    date.getMonth(),
    date.getFullYear(),
  ];
  let current_month = months[month];
  return (
    <div className="covid">
      <div className="alert__text">
        <p>
          UPDATE NEWS ABOUT {<HiOutlineChevronDoubleRight />}
          Information about Covid-19 vaccine
        </p>
      </div>
      <div className="date__container">
        <p>
          {today} {current_month} {year}
          <span className="date__day"></span>
        </p>
      </div>
    </div>
  );
}

export default CovidAdd;
